    data: |
      SELECT 74 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 NOT IN ( + col1, + col1 / - + 35 + - 2 );
  - name: tab1

outputs:
  - name: q10013.out
    data: |
      74
      74
      74
